                    title="Półkolonia dla chłopców z rocznika 2008/2009"
                    src={image}
                />
                <NewsListedSmall 
                    title="Półkolonia dla chłopców z rocznika 2008/2009"
                    src={image}
                />
                <NewsListedSmall 
                    title="Półkolonia dla chłopców z rocznika 2008/2009"
                    src={image}
                />
            </div>
            <SecondaryButton
                text="Wszystkie aktualności"
            />
        </div>
    )
}
